import React from 'react';
import '../../App.css';
import Carditem from '../Carditem';
import './about.css';
import Cards from '../Cards';

function About() {
  return (
  <div className='main'>
    
  <div className='container'>
   
      <img src={require('../images/img-9.jpg').default}/>
      <div class="centered">
       
      At Nirwana Hotels, we want to make it easy to celebrate any moment together<br></br>
     
      </div>
      
      </div>
      <div className='cards'>
           
                <div className='cards__container'>
                <h1>Our Story</h1>
                <div class="row">
                  <div class="col md-6">
                <Carditem 
                           src={require('../images/man1.jpg').default}
                            text='Explore the hidden waterfall deep inside the Amazon jungle'
                            label='Adventure'
                            path='/services'/></div>
                            <div class="col md-6">
                <Carditem 
                           src={require('../images/man2.jpg').default}
                            text='Explore the hidden waterfall deep inside the Amazon jungle'
                            label='Adventure'
                            path='/services'/></div>
                            <div class="col md-6">
                <Carditem 
                           src={require('../images/man3.jpg').default}
                            text='Explore the hidden waterfall deep inside the Amazon jungle'
                            label='Adventure'
                            path='/services'/></div>
                            <div class="col md-6">
                <Carditem 
                           src={require('../images/man4.jpg').default}
                            text='Explore the hidden waterfall deep inside the Amazon jungle'
                            label='Adventure'
                            path='/services'/></div>
                    </div>        
                </div>
            
            </div>
     
  
  </div>
  );
}
export default  About;
